let lista = []

let home = (req, res) => res.send()
let dodaj = (req, res) => {
    lista.push(Math.floor(Math.random() * Math.floor(100)))
    res.send(console.log(lista))
}
let dohvati = (req, res) => {
    res.send(lista.join(' '))
}
export default { home, dodaj, dohvati }

